import React from "react";
import "./contact.scss";

function Contact() {
  return (
    <div className="contact">
      <div className="left">
        <img src="assets/shake.svg" alt="" />
      </div>
      <div className="right">
        <h2>Contact.</h2>
        <form></form>
      </div>
    </div>
  );
}

export default Contact;
